import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
            <link rel="stylesheet" 
            href="https://cdnjs.cloudflare.com/ajax/libs/bootswatch/4.3.1/cerulean/bootstrap.css" />
        </Head>
        <Navbar />
        <div className="container">
        </div>
        {props.children}
    </div>
);

export default Layout
